import { Link, useStaticQuery, graphql } from "gatsby"
import PropTypes from "prop-types"
import React from "react"
import { View } from "react-native"
import Image from "./img"

const Header = ({ siteTitle }) => (
  <div>
    <div style={{ display: "flex", flexDirection: "row" }}>
      <Link to="/">
        <Image
          imgData={useStaticQuery(graphql`
        query {
            placeholderImage: file(relativePath: { eq: "icon/icon.png" }) {
                childImageSharp {
                    fluid(maxWidth: 300) {
                        ...GatsbyImageSharpFluid
                    }
                }
            }
        }`)}
          style={{}}
        />
      </Link>
      <div style={{ backgroundColor: "#ff0", flex: 1, height: 100 }}></div>
    </div>
    <View style={{ backgroundColor: "#f0f", height: "100vh", width: "100vw", position: "absolute", top: 100, left: 0, zIndex: 100 }}>

    </View>
  </div>
)

Header.propTypes = {
  siteTitle: PropTypes.string,
}

Header.defaultProps = {
  siteTitle: ``,
}

export default Header
